import React from "react";
import Carousel from 'react-bootstrap/Carousel';
import { StarWarsCarouselModels } from "../models";
import { carouselPicores } from '../data/carouselData';

function StarWarsCarousel() {





  return (
    <Carousel variant="dark">

{carouselPicores.map((element, key) => <Carousel.Item> 
    <img className="b-block w-10"
           src={element.src}
           alt={element.alt} key={key} />

     </Carousel.Item>)}



    </Carousel>
  );
}

export default StarWarsCarousel;


